import { toast } from 'react-toastify'
import 'react-toastify/dist/ReactToastify.css'
import './App.css';

toast.configure()
function App() {
  const notify = () => {
    toast('Basic notification!', { position: toast.POSITION.TO })
  }
  return (
    <div className="App">
      <button onClick={notify}>Notify!</button>
    </div>
  );
}

export default App;
